import { Box, Flex, Text } from "@chakra-ui/react";
const container = ({title}) => {
  return (
    <Fragment>

        <Box

        bgColor="gray.300" >
<Flex>

      <Box mt="25px">
        <Text
          color="#fff"
          textAlign="center"
          fontSize={{ base: "16px", md: "24px" }}
          fontWeight={700}
        >
          {title}
        </Text>
      </Box>

      <Box>

      </Box>
</Flex>
        </Box>
    </Fragment>
  );
};

export default container;
